findStrings.find:
function makeTest\(x\, y\) \{
 let expected \= 1\;
 for \(let i \= 1\; i \<\= y \; i\+\+\) \{
 expected \*\= x\;
 \}
 it\(\`\$\{x\} expected \$\{y\} result \$\{expected\}\`\, function \(\) \{
 assert\.equal\(pow\(x\, y\)\, expected\)\;
 \}\)\;
 \}

 for \(let y \= 1\; y \<\= 10\; y\+\+\) \{
 for \(let x \= 1\; x \<\= 10 \; x\+\+\) \{
 makeTest\(x\, y\)\;
 \}
 \}
